// Importa as bibliotecas e componentes necessários
import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import { AppRoutes } from "./Routes";

// Define o componente principal App
function App() {
  return (
    // Usae o componente Router para ativar o roteamento
    <Router>
      {/* Usa o componente AppRoutes para definir as rotas para a aplicação */}
      <AppRoutes />
    </Router>
  );
}

// Exporta o componente App como exportação padrão
export default App;
